BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Article" (
	"id"	TEXT NOT NULL,
	"title"	TEXT NOT NULL,
	"content"	TEXT NOT NULL,
	"authorId"	TEXT NOT NULL,
	"createdAt"	DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
	"updatedAt"	DATETIME,
	"imageUrl"	TEXT,
	PRIMARY KEY("id"),
	CONSTRAINT "Article_authorId_fkey" FOREIGN KEY("authorId") REFERENCES "User"("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Comment" (
	"id"	TEXT NOT NULL,
	"content"	TEXT NOT NULL,
	"authorId"	TEXT NOT NULL,
	"articleId"	TEXT,
	"createdAt"	DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
	"updatedAt"	DATETIME,
	PRIMARY KEY("id"),
	CONSTRAINT "Comment_articleId_fkey" FOREIGN KEY("articleId") REFERENCES "Article"("id") ON DELETE SET NULL ON UPDATE CASCADE,
	CONSTRAINT "Comment_authorId_fkey" FOREIGN KEY("authorId") REFERENCES "User"("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Dislike" (
	"id"	TEXT NOT NULL,
	"userId"	TEXT NOT NULL,
	"articleId"	TEXT,
	"commentId"	TEXT,
	PRIMARY KEY("id"),
	CONSTRAINT "Dislike_articleId_fkey" FOREIGN KEY("articleId") REFERENCES "Article"("id") ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT "Dislike_commentId_fkey" FOREIGN KEY("commentId") REFERENCES "Comment"("id") ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT "Dislike_userId_fkey" FOREIGN KEY("userId") REFERENCES "User"("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "User" (
	"id"	TEXT NOT NULL,
	"username"	TEXT NOT NULL,
	"password"	TEXT NOT NULL,
	"bio"	TEXT,
	"createdAt"	DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
	"iconName"	TEXT DEFAULT 'Skull',
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "_prisma_migrations" (
	"id"	TEXT NOT NULL,
	"checksum"	TEXT NOT NULL,
	"finished_at"	DATETIME,
	"migration_name"	TEXT NOT NULL,
	"logs"	TEXT,
	"rolled_back_at"	DATETIME,
	"started_at"	DATETIME NOT NULL DEFAULT current_timestamp,
	"applied_steps_count"	INTEGER UNSIGNED NOT NULL DEFAULT 0,
	PRIMARY KEY("id")
);
